import React, { Component } from 'react';
import './App.css';

class Pricing extends Component {
    render() {
      return (
        <div>
          <h1> Pricing </h1>
          <p> Simple OKRs is currently free for everyone.</p>
          <h3> -- </h3>
          <p>If Simple OKRs helped you achieve your goals, support development costs / buy me a coffee by donating at <a href= "https://www.paypal.me/seanmichaelcoleman"> PayPal</a>. </p>
        </div>
      )
    }
}

export default Pricing;
